```javascript
\/\/ fileToTest.test.js
import React from 'react';
import MyComponent from '.\/fileToTest';

\/\/ Mock the MyComponent module using jest.mock()
jest.mock('.\/fileToTest', () => ({
  MyComponent: jest.fn(() => <div>Mocked component<\/div>),
}));

describe('MyComponent', () => {
  it('renders correctly', () => {
    const wrapper = mount(<MyComponent \/>);
    expect(wrapper.text()).toBe('Mocked component');
  });
});
```
In this example, we have a file called `fileToTest.js` that exports a React component called `MyComponent`. To mock this component in our test file `fileToTest.test.js`, we use `jest.mock()` to create a mock implementation of the `MyComponent` module.

We pass the path to the module we want to mock as the first argument to `jest.mock()`, and an object containing the mocked modules as the second argument. In this case, we're only mocking the `MyComponent` module, so we pass an object with a single property:
```css
{
  MyComponent: jest.fn(() => <div>Mocked component<\/div>)
}
```
The `jest.fn()` function creates a new mock function that returns the `Mocked component` element. We pass this mock function as the value of the `MyComponent` property in the object we pass to `jest.mock()`.

Now, when we run our test using `jest`, it will use the mocked version of `MyComponent` instead of the real implementation. We can then write tests that interact with the mocked component, knowing that it will behave as expected.

