To convert an array of JSON objects to CSV format in JavaScript, you can use the `Array.prototype.map()` method to transform each object into a CSV row, and then concatenate the rows into a single CSV string.

Here's an example of how you can do this when the JSON objects inside the array can have different keys and can have overlapping keys:
```
const jsonArray = [
  { id: 1, name: 'John', age: 30 },
  { id: 2, name: 'Jane', age: 25 },
  { id: 3, name: 'Bob', age: 40 },
  { id: 1, name: 'John', age: 31 },
];

const csv = jsonArray.map(obj => {
  const csvRow = [];
  for (const key in obj) {
    if (obj.hasOwnProperty(key)) {
      csvRow.push(`"${key}"="${obj[key]}"`);
    }
  }
  return csvRow.join(',');
}).join('\n');

console.log(csv);
```
This code will output the following CSV string:
```
