```
In this example, we have a file called `fileToTest.js` that exports a React component called `MyComponent`. To mock this component in our test file `fileToTest.test.js`, we use `jest.mock()` to create a mock implementation of the `MyComponent` module.

We pass the path to the module we want to mock as the first argument to `jest.mock()`, and an object containing the mocked modules as the second argument. In this case, we're only mocking the `MyComponent` module, so we pass an object with a single property:
